import './index.css'
import logo from './logo.png'
import icon from './user-profile-icon.png'

const LandingPage = () => {
    return(
        <>
            <header>
                <nav>
                    <img className='logo-img' src={logo} alt='site logo'></img>
                </nav>
            </header>
        </>
    )
}

export default LandingPage;
